The given quadratic equation is in the standard form ax^2 + bx + c = 0. Here a=19, b= -323, and c=820. Since factoring seems to be a little complicated in this case, we SWITCH and use the quadratic formula to find the roots. The formula is:

x=(-b±√(b^2-4ac))/2a

After substituting the values we get:

x=(323±√((-323)^2-4*19*820))/(2*19);
x=(323±√((104329-62160)))/38;
x=(323±√(42169))/38;
x=(323±205)/38;

This gives two solutions:

x1=(323+205)/38 = 528/38 = 14,

and

x2=(323-205)/38 = 118/38 = 3.1.

Hence, the roots of the equation 19x^2 - 323x + 820 = 0 are 14 and 3.1.
